import React, {useContext} from 'react'
import AppContext from '../AppContext'
import BanksComponentv2 from '../Components/BankComponentv2'
function Accountsv2() {
    const { banks } = useContext(AppContext)




  return (
    <div>
      <div className='login_wrapper' style={{minHeight:"600px"}}>
        <div style={{display:"grid", justifyContent: "space-around"}}>
          <BanksComponentv2 stylingContext = {banks}/>
        </div>
      </div>
    </div>
  )
}

export default Accountsv2
